    [],nt"relationships_as_subject": [],nt"revision_timestamp": "2013-03-14T15:14:04.586453",nt"name":
    "tipping-bucket-rain-gauge",nt"isopen": false,nt"url": null,nt"notes":
    "The Novalynx tipping bucket rain gauge (model 260-2500E-12), located next to the
    disdrometer, measures the character and amount of liquid precipitation. The instruments
    make completely different kinds of measurements, but data from both instruments
    can be used to determine rain rate. The rain gauge is the conventional tipping bucket
    type. Each tip collects an amount equivalent to 0.01inch of water and each tip is
    counted by a data acquisition system anchored by a Campbell CR1000 data logger.
    Data are collec ted once a minute.",nt"license_title": null,nt"extras":
